  // Cube parameters
  $colorBorder: #f5f5f5;
  $colorMin: #dddddd;
  //$colorMax: #505050;
  $colorMax: #dddddd;
  $size: 30px;
  // Time parameters
  $duration: 1s;
  $wait: 20%;
  $borderSize: $size * 0.1;

  .spinner-wrap {
    perspective: 2 * $size;
    perspective-origin: 50% 0px;
    min-height: 50px;
    padding-top: 3px;
    align-self: center;
  }

  .spinner-cube {
    position: relative;
    width: $size;
    transform-style: preserve-3d;
  }

  .spinner-cube div {
    position: absolute;
    width: $size;
    height: $size;
  }

  .spinner-front {
    background: $colorMin;
    border: $borderSize solid $colorBorder;
    transform: translateZ($size * 0.5);
    animation: colorsf $duration ease-in-out infinite;
    -moz-animation: colorsf $duration ease-in-out infinite;
    -webkit-animation: colorsf $duration ease-in-out infinite;
    -o-animation: colorsf $duration ease-in-out infinite;
